/**
 * @param {string} s
 * @return {number}
 */
var lengthOfLongestSubstring = function (s) {
    const hashMap = new Map();
    let result = [];
    let length = s.length;

    if (s.length === 0) {
        return 0;
    }

    if (s.length === 1) {
        return 1;
    }

    for (let i = 0; i < length; i++) {
        let j = i + 1;
        hashMap.set(s[i], true);
        while (!hashMap.has(s[j]) && j < length) {
            hashMap.set(s[j], true);
            j++;
        }
        result.push(j - i);
        hashMap.clear();
    }

    return result.reduce((prev, next)=> {
        return Math.max(prev, next);
    }, 0);
};


